import React from "react";
import { Container, Typography } from "@mui/material";
import { CompanyName, Logo } from "./styles";
import ComapnyLogo from "./logo.svg";
import "./App.css";
import { Box } from "@mui/system";

function App() {
  return (
    <Container sx={{ backgroundColor: "red" }} maxWidth="xl">
      <Logo src={ComapnyLogo} alt="comapny_logo" />
      <Box sx={{ display: "flex", justifyContent: "center" }}>
        <Typography fontFamily={"cursive"} variant="h2" gutterBottom>
          Comapny Name
        </Typography>
      </Box>
    </Container>
  );
}

export default App;
